        terms_of_service_text: '<h1>Aviso legal</h1>                <p>Has accedido a FILMIN, la plataforma digital sobre cine independiente de uso estrictamente doméstico y particular, en la que podrás recibir información gratuita, visionar contenidos gratuitos y de pago y disfrutar de otros servicios profesionales a través de la dirección Web www.filmin.com, cuya titularidad ostenta COMUNIDAD FILMIN, S.L. El uso y acceso a los contenidos que alberga la presente Página Web implica el conocimiento y aceptación de las presentes Condiciones Generales que tienen como objetivo poner en conocimiento de los usuarios los derechos, usos, prohibiciones, responsabilidades, etc., que rigen a la hora de navegar y hacer uso de los diferentes servicios contenidos en el presente Web Site.</p>                <h1>Objeto</h1>             <p>Las presentes Condiciones Generales regulan el acceso, navegación y uso de la Página Web www.filmin.com. Del mismo modo, se regulan las responsabilidades derivadas de la utilización de sus contenidos -textos, diseños, fotografías, contenidos, bases de datos, imágenes, informaciones así como cualquier otra creación protegida por las leyes nacionales y tratados internacionales sobre propiedad intelectual e industrial.</p>              <h1>Titularidad</h1>                <p>Exclusivamente el nombre de dominio www.filmin.com, a través del cual se accede a FILMIN es titularidad de la entidad COMUNIDAD FILMIN, S.L., con domicilio social en C/ Plató 26 de Barcelona, con CIF B64582471 Inscrita en el Registro Mercantil de Barcelona Tomo 39697, Folio 61, Hoja B3514141, Inscripción 1</p>              <h1>Contacto</h1>               <p>COMUNIDAD FILMIN, S.L. pone en tu conocimiento los diferentes medios de contacto, a través de los cuales podrás remitirnos cualquier queja, reclamación, sugerencia, cuestión o comentario que estimes oportunos.</p>                <p>Fax: (+34) 93 417 70 06</p>              <p>Correo electrónico: contacto@filmin.es</p>               <p>Correo Postal: COMUNIDAD FILMIN, S.L. C/ Plató 26 08006 Barcelona</p>                <h1>Utilización de la Página Web y Servicios</h1>               <p>La navegación y el uso de la Página Web contiene servicios gratuitos y de pago. Los servicios de pago se encuentran regulados bajos sus propias Condiciones Particulares y se entenderán aceptadas, por parte del usuario, de forma expresa e incondicional, en el mismo momento en el que haga uso, utilización o puesta a disposición de los mismos. Todos los servicios de pago requieren de un registro previo regulado por la Ley de protección de datos personales vigente. El servicio de streaming de alta calidad puede pagarse mediante tarjeta de crédito, Paywizard, Google Checkout o mediante códigos promocionales facilitados por COMUNIDAD FILMIN, S.L. o terceras empresas. Salvo en este último caso, el pago dará derecho a visionar el contenido adquirido durante 48h a partir del momento en el que se inicie el mismo.</p>               <h2>Política de seguridad</h2>              <p>Toda la información de transacciones que se transmite entre filmin y los sistemas de PAYTPV se cifra mediante certificados SSL de 128 bits. Toda la información del titular se transmite cifrada y todos los mensajes enviados a sus servidores desde PAYTPV se firman mediante hashing SHA para evitar su manipulación. La información que se transmite a los servidores de PAYTPV no se puede examinar, escanear, utilizar o modificar por cualquier externo que obtenga acceso a información confidencial.</p>                <h2>Cifrado y almacenamiento de datos</h2>              <p>Una vez en los sistemas de PAYTPV, la información confidencial se protege utilizando estándares de cifrado de 1024 bits. Las claves de cifrado se mantienen en sistemas de alta seguridad volátiles y con doble autenticación lo que imposibilita su extracción. Bancos, agentes de seguridad y entidades bancarias realizan auditorías con regularidad para garantizar la protección de los datos.</p>              <h2>Seguridad en los sistemas</h2>              <p>Los sistemas de PAYTPV se examinan trimestralmente mediante herramientas específicas ISO, un Asesor de Seguridad Cualificado (QSA) independiente y un proveedor de exploración aprobado (ASV) por las marcas de tarjetas de pago.</p>                <p>PAYTPV también se somete a una auditoría anual según los estándares de seguridad de datos del sector de tarjetas de pago (PCI DSS) y es un proveedor de servicios de pago de Nivel 1 totalmente aprobado, que es el mayor nivel de cumplimiento.</p>             <h2>Enlaces con entidades bancarias</h2>                <p>PAYTPV tiene varios enlaces privados con redes bancarias que son completamente independientes de internet y que no atraviesan ninguna red de acceso público. Toda la información del titular enviada a los bancos y todos los mensajes de autorización enviados como respuesta están protegidos y no se pueden manipular.</p>                <h2>Seguridad interna</h2>              <p>PAYTPV está auditado en controles de acceso a los entornos de producción. Los CPD donde se alojan los sistemas operan conforme a los requisitos para los centros Tier III. De esta forma se garantiza que la seguridad no se ponga en riesgo en ningún momento. Se dispone de sofisticados sistemas de alarma, vigilancia mediante circuitos cerrados de TV y vigilantes de seguridad, presentes 24 horas al día y 7 días a la semana en las instalaciones, así como de una monitorización y un mantenimiento rigurosos. Toda la información de transacciones y tarjetas de clientes está protegida incluso de nuestros propios empleados.</p>               <h2>Recuperación de desastres</h2>              <p>PAYTPV dispone de sistemas de Backup alojados en diferentes países para garantizar una seguridad de sistemas óptima y una alta disponibilidad. Asimismo, cuenta con una política de continuación comercial y recuperación de desastres completa.</p>             <h1>Cookies</h1>                <p>Las cookies son paquetes de información almacenados de forma automática por el navegador web que permiten acciones como recordar contraseña o elaborar consultas más rápidas en filmin.es. El usuario puede borrar las cookies de su disco duro siempre que lo desee. Si no desea que las cookies sean almacenadas, deberá configurarse el navegador web para tal uso. En caso de no almacenarlas, algunas funcionalidades de filmin.es no estarán disponibles, pero sí se podrá navegar por la web. La información es únicamente para el uso particular de COMUNIDAD FILMIN, S.L.: no revelamos ni compartimos esta información con terceras partes. En caso de no desear que filmin.es tenga esta información, debe modificar la configuración de las cookies en su navegador.</p>             <p>Le informamos que nuestra página web utiliza cookies para analizar la navegación de usuarios (estadísticas de navegación). Las cookies son archivos de texto que se guardan en el equipo desde el que accede a nuestra web con las finalidades que se describen a continuación. La aplicación utilizada para obtener y analizar la información de la navegación es:</p>              <p>Google Analytics: www.google.com/analytics y http://www.google.es/intl/es/analytics/privacyoverview.html</p>             <p>Esta aplicación ha sido desarrollada por Google, que presta el servicio de análisis de la audiencia de nuestra página. Esta empresa puede utilizar estos datos para mejorar sus propios servicios y para ofrecer servicios a otras empresas. Puede conocer esos otros usos desde los enlaces indicados.</p>              <p>Esta herramienta no obtiene datos de los nombres o apellidos ni de la dirección postal desde donde se conectan ni cualquier otro dato personal identificativo del usuario.</p>               <p>La información que obtiene está relacionada con el número de páginas visitas, el idioma, red social en la que se publican nuestras noticias, la ciudad a la que está asignada la dirección IP desde la que acceden los usuarios, el número de usuarios que nos visitan, la frecuencia y reincidencia de las visitas, el tiempo de visita, el navegador que usan, el operador o tipo de terminal desde el que se realiza la visita. Esta información la utilizamos para mejorar nuestras páginas, detectar nuevas necesidades y valorar las mejoras a introducir con la finalidad de prestar un mejor servicio a los usuarios que nos visitan, adaptándolas por ejemplo a los navegadores o terminales más utilizados.</p>                <p>Para permitir, conocer, bloquear o eliminar las cookies instaladas en su equipo puede hacerlo mediante la configuración de las opciones del navegador instalado en su ordenador. Puede encontrar información sobre cómo hacerlo en el caso que use como navegador:</p>               <p>Firefox: http://support.mozilla.org/es/products/firefox/cookies</p>              <p>Chrome: http://support.google.com/chrome/bin/answer.py?hl=es&answer=95647</p>                <p>Internet Explorer: http://windows.microsoft.com/es-es/windows7/how-to-manage-cookies-in-internet-explorer-9</p>              <p>Safari: http://support.apple.com/kb/ph5042</p>               <p>Opera: http://www.opera.com/help/tutorials/security/privacy/</p>             <h1>GARANTÍA DE SERVICIO</h1>               <p>COMUNIDAD FILMIN,S.L. garantiza la calidad de sus servicios de pago y ante la posibilidad de que se produzcan incidencias debido a causas técnicas ponemos a disposición de nuestro usuarios los siguientes contactos:<br />     -Para cualquier problemas o duda: contacto@filmin.es</p>                <h1>Precios</h1>                <p>COMUNIDAD FILMIN,S.L. podrá modificar el precio del Servicio Premium en su momento. Dicha modificación en el precio será efectiva una vez transcurrido el periodo de pago corriente en dicho momento (a saber, el periodo por el que ya haya usted pagado). De acuerdo al Art. 102 del Real Decreto Legislativo 1/2007 el consumidor no tendrá derecho a desistir del film o de la suscripción contratada. El usuario recibirá un mail acreditativo de la compra (del film o suscripción premium). El usuario podrá cancelar la renovación de su suscripción hasta 1 hora antes de que se le efectúe el siguiente cobro.</p>             <p>De acuerdo al artículo 102 de RDL 1/2007, de 16 de noviembre, el consumidor no tendrá derecho desistimiento sobre los productos audiovisuales contratados debido a la naturaleza de los mismos.</p>              <h1>Derechos de Propiedad Intelectual e Industrial</h1>             <p>COMUNIDAD FILMIN, S.L. es titular o tiene la correspondiente licencia de uso sobre los derechos de explotación de propiedad intelectual e industrial de la Página Web, así como de los contenidos disponibles, para el ámbito doméstico y particular, a través de la misma. En ningún caso, se entenderá que el hecho de permitir a los usuarios el acceso a la Página Web implica una renuncia, transmisión, licencia o cesión, total ni parcial, de dichos derechos, por parte de COMUNIDAD FILMIN, S.L. Queda prohibido modificar, copiar, reutilizar, explotar, reproducir, comunicar públicamente, hacer segundas o posteriores publicaciones, cargar archivos, enviar por correo, transmitir, usar, tratar o distribuir de cualquier forma la totalidad o parte de los contenidos incluidos en la presente Página Web para propósitos públicos o comerciales si no se cuenta con la autorización expresa y por escrito de COMUNIDAD FILMIN, S.L. o, en su www.filmin.es, titularidad de COMUNIDAD FILMIN, S.L., no podrá ser utilizado, en conexión con otros contenidos, productos o servicios que no sean titularidad de aquel, cuando puedan causar confusión entre los usuarios finales o el descrédito de la entidad.</p>             <h1>Duración y Modificación</h1>                <p>Las presentes Condiciones Generales tienen la vigencia que dura su exposición. De esta forma, COMUNIDAD FILMIN, S.L. aconseja que, cada vez que los usuarios accedan a la Página Web lean con detenimiento las mismas. COMUNIDAD FILMIN, S.L. se reserva el derecho de modificación unilateral de las Condiciones Generales en cualquier momento, en su totalidad o parcialmente. La modificación surtirá efectos desde su publicación en la Página Web, más concretamente, desde su inserción en el link "Aviso Legal".</p>             <h1>Ley Aplicable y Jurisdicción</h1>               <p>Se someterán, de acuerdo con el Art. 90 del Real Decreto Legislativo 1/2007 al Juzgado correspondiente con el domicilio del consumidor.</p>              <h1 class="privacy_policy">Cláusulas Legales, Condiciones de uso y Protección de datos.</h1>                <p>Mediante este aviso, COMUNIDAD FILMIN, S.L., domiciliada en C/ Plató 26, 08006 Barcelona con CIF B64582471 contacto@filmin.es informa al usuario ("Usuario") de los datos personales que le solicita, con el fin de que los Usuarios determinen libre y voluntariamente si desean facilitar a COMUNIDAD FILMIN, S.L. los datos personales (en adelante "Datos Personales") que se les puedan requerir o que se puedan obtener de los Usuarios con ocasión de la suscripción o alta como registros en el portal explotado por COMUNIDAD FILMIN, S.L. alojado en la URL: www.filmin.es o de los servicios que se puedan contratar o comprar a través de dicho portal.</p>              <p>Los Datos Personales recogidos serán objeto de tratamiento automatizado e incorporados a los correspondientes ficheros automatizados por COMUNIDAD FILMIN, S.L., siendo COMUNIDAD FILMIN, S.L. titular y responsable de dicho fichero (en adelante, el "Fichero"). Con este objeto, COMUNIDAD FILMIN, S.L. proporcionará a los Usuarios los recursos técnicos adecuados para que, con carácter previo, puedan acceder a este aviso sobre la Política de Protección de Datos o a cualquier otra información relevante y puedan prestar su consentimiento a fin de que COMUNIDAD FILMIN, S.L. proceda al tratamiento automatizado de sus Datos Personales.</p>             <p>En el caso de servicios contratados por el Usuario distintos de la suscripción, COMUNIDAD FILMIN, S.L. deberá suministrar a aquellos intervinientes en los servicios solicitados por el Usuario los datos necesarios para que los mismos presten los servicios contratados por el Usuario. Salvo en los campos en que se indique lo contrario, las respuestas a las preguntas sobre Datos Personales son voluntarias, sin que la falta de contestación implique una merma en la calidad o cantidad de los servicios correspondientes, a menos que se indique otra cosa.</p>              <p>Los datos de carácter personal, serán tratados con el grado de protección adecuado, tomándose las medidas de seguridad legalmente necesarias para evitar su pérdida, deterioro y suministro y acceso a terceros no autorizados. Ello no obstante, el Usuario debe ser consciente de que las medidas de seguridad en Internet no son inexpugnables.</p>               <p>COMUNIDAD FILMIN, S.L. utilizará los datos suministrados por el Usuario para su suministro a los intervinientes en los servicios solicitados por el Usuario, asimismo, COMUNIDAD FILMIN, S.L. utilizará los datos suministrados por el Usuario para el mantenimiento de la relación contractual en su caso establecida con COMUNIDAD FILMIN, S.L., para dar a conocer al Usuario ofertas y promociones que pudiera considerar de interés para el mismo, la gestión, administración, prestación, ampliación y mejora de los servicios en los que el Usuario decida suscribirse, darse de alta, o utilizar la adecuación de dichos servicios, el envío de actualizaciones de los servicios, el envío, por medios tradicionales y electrónicos, de información técnica, operativa y comercial acerca de productos y servicios ofrecidos por COMUNIDAD FILMIN, S.L..</p>             <p>COMUNIDAD FILMIN, S.L. utilizará cookies cuando el Usuario navegue por el sitio Web de COMUNIDAD FILMIN, S.L. Las cookies se asocian únicamente con un Usuario anónimo y su ordenador y no proporcionan referencias que permitan deducir el nombre y apellidos del Usuario. Las cookies de COMUNIDAD FILMIN, S.L. no pueden leer datos de su disco duro ni leer los archivos cookie creados por otros proveedores. COMUNIDAD FILMIN, S.L. cifra los datos identificativos del Usuario para mayor seguridad. Gracias a las cookies, resulta posible que COMUNIDAD FILMIN, S.L. reconozca a los Usuarios registrados después de que éstos se hayan registrado por primera vez, sin que se tengan que registrarse en cada visita para acceder a las áreas y servicios reservados exclusivamente a ellos. El Usuario tiene la posibilidad de configurar su navegador para ser avisado en pantalla de la recepción de cookies y para impedir la instalación de cookies en su disco duro. Por favor, consulte las instrucciones y manuales de su navegador para ampliar ésta información. Para utilizar el sitio Web de COMUNIDAD FILMIN, S.L., no resulta necesario que el Usuario permita la instalación de las cookies enviadas por COMUNIDAD FILMIN, S.L., sin perjuicio de que en tal caso será necesario que el Usuario se registre cada vez que acceda a un servicio que requiera el previo registro.</p>               <p>Finalmente, en cumplimiento de lo establecido en la LOPD, el Usuario podrá ejercer sus derechos de acceso y rectificación de sus datos personales a los ficheros de COMUNIDAD FILMIN, S.L. mediante el envío de una comunicación al domicilio social de la compañía sito en, COMUNIDAD FILMIN, S.L., domiciliada en C/ Plató 26. 08006 Barcelona con CIF B64582471. Como responsable del fichero, esta comunicación también podrá ser realizada mediante el envío de un correo electrónico a la dirección: contacto@filmin.es</p>                <p>COMUNIDAD FILMIN, S.L. Registro Mercantil de Barcelona, Tomo 39697, Folio 61, Hoja B351414, Inscripción 1. C.I.F B64582471</p>'
